import React, { useState } from "react";

//design
import Grid from '@material-ui/core/Grid';
import {makeStyles} from '@material-ui/core/styles';
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import OutlinedInput from '@material-ui/core/OutlinedInput';

//components
import logo from './assets/img/logo.svg'
import PrincipalButton from "./components/PrincipalButton/PrincipalButton.js";


//styles
import './App.css';


const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
    },
    logo:{
        backgroundImage: "url(./assets/img/logo.png)",
        height:"30vh",
        width:"15vw"
    },
    buttons:{
        height:"25vh",
        width:"25vw"
    },

    header:{
        height:"15vh",
        paddingTop: "5%"
    }
}));


const [email, setEmail] = useState("");
//const [password, setPassword] = useState("");

/*function handleSubmit(event) {
    event.preventDefault();
}*/

function App() {
    const classes = useStyles();

    return (
    <div className="App">
        <Grid container direction="column">
            <Grid container item className={classes.header}/>
            <form>
                <Grid  direction="row" justify="center">
                    <img src={logo} className={classes.logo} alt="Loto punto"/>
                </Grid>
                <Grid  direction="row">
                    <FormControl variant="outlined" >
                        <InputLabel htmlFor="username">Email</InputLabel>
                        <OutlinedInput id="username" label="username" value={email} onChange={e => setEmail(e.target.value)}/>
                    </FormControl>
                </Grid>
                <Grid  direction="row">
                    <FormControl variant="outlined">
                        <InputLabel htmlFor="password">Password</InputLabel>
                        <OutlinedInput id="password " label="Password" value={password} onChange={e => setPassword(e.target.value)}/>
                    </FormControl>
                </Grid>
                <Grid>
                    <PrincipalButton>
                        <h4>LOG IN</h4>
                    </PrincipalButton>
                </Grid>
            </form>
        </Grid>
    </div>
  );
}

export default App;
